import React from 'react';
import todoData from './TodoData';

function App() {
    return (
        <div>
            <Header />
            <Body />
            <Footer />
        </div>
    )
}
function Header() {
    return (
        <header className="header">
            <h1>Welcome to my to do list</h1>
        </header>
    )
}
function Body() {
const todoComponents = todoData.map(todo => <ToDoItem text={todo.text} completed={todo.completed}/>)

    return (
        <div className="content">
            <h2 className="heading">These are my favourite foods</h2>
            {todoComponents}
        </div>
    )
}
function ToDoItem() {
    return (
        <div className="todo-item">
            <input type="checkbox"></input> <label>{props.text}</label> <br />
        </div>
    )
}
function Footer() {
    return (
        <div>
            This is footer.
</div>
    )
}
export default App;
